    false,nt"url": null,nt"notes": "This layer of the National Elevation Dataset
    (NED) is 1 arc-second (approximately 30 m) resolution. The 1 arc-second NED are
    derived from diverse source data that are processed to a common coordinate system
    and unit of vertical measure. These data are distributed in geographic coordinates
    in units of decimal degrees, and in conformance with the North American Datum of
    1983 (NAD 83). All elevation values are in meters and, over the continental United
    States, are referenced to the North American Vertical Datum of 1988 (NAVD88). The
    1 arc-second NED layer provides seamless coverage of the conterminous United States,
    Hawaii, Mexico, Canada, Puerto Rico, other territorial islands, and in limited areas
    of Alaska. The 1 arc-second NED layer is available as pre-staged products tiled
    in 1 degree blocks in Erdas .img, ESRI arc-grid, and grid float formats. The NED
    is updated continually as new data become available. All NED data are in the public
    domain.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
